Бильфельд: Волнистые попугайчики – Содержание, уход, кормление, разведение.

Содержание:
* Предоставление простого обитательства для птицы;
* Включение в рацион разнообразных фруктов и овощей.

Уход:
* Суточная замена воды и питания;
* Мытьё попугайчика один-два раза в неделю.

Кормление:
* Рацион разнообразных фруктов и овощей;
* Добавление витаминов к воде для питания птиц.

Разведение:
* Определение пола молодых особей в возрасте от 1 до 2 недель с помощью эндоскопии или расщепления;
* Наблюдение за первыми стадиями развития яйца в течение 14-35 дней.
